        maze.append(row)
    return maze

def print_maze(maze):
    for row in maze:
        print(''.join(row))

def find_start(maze):
    for i, row in enumerate(maze):
        for j, cell in enumerate(row):
            if cell == 'S':
                return i, j

def find_end(maze):
    for i, row in enumerate(maze):
        for j, cell in enumerate(row):
            if cell == 'E':
                return i, j

def find_path(maze, start, end):
    path = []
    current = start
    while current != end:
        i, j = current
        if i > 0 and maze[i-1][j] == ' ':
            current = i-1, j
        elif i < len(maze)-1 and maze[i+1][j] == ' ':
            current = i+1, j
        elif j > 0 and maze[i][j-1] == ' ':
            current = i, j-1
        elif j < len(maze[0])-1 and maze[i][j+1] == ' ':
            current = i, j+1
        else:
            return None
        path.append(current)
    return path

def main():
